import { PrismaClient } from "@prisma/client";

const prisma = new PrismaClient();

async function main() {
  const shelf = await prisma.shelf.create({
    data: {
      name: "Playstation 4",
      color: "#003791",
      imageUrl:
        "data:image/png;base64,",
      items: {
        create: [
          {
            name: "Cuphead - Édition Limitée",
            condition: "NEW",
            barcode: "0811949036032",
            description:
              "Jeu acheté neuf, édition limitée et figurine d'occasion.",
            imageUrl:
              "data:image/jpeg;base64,",
          },
        ],
      },
    },
  });

  console.log("Seeded shelf:", shelf);
}

main()
  .catch((e) => {
    console.error(e);
    process.exit(1);
  })
  .finally(() => {
    prisma.$disconnect();
  });
